import React from "react";
import { Link } from 'react-router-dom';

import './JIRApage.css';

function JIRACreate() {
    return(
        <div className="inputContainer">
            <div className="inputArea">
                <div c>ProblemStatement</div>
                <div><textarea className="fixed-textarea" /></div>
            </div>
            <div className="inputArea">
                <div>Acceptance Criteria</div>
                <div><textarea className="fixed-textarea" /></div>
            </div>
            <div className="inputArea">
                <div>Defination of Done</div>
                <div><textarea className="fixed-textarea" /></div>
            </div>
        </div>
    );
}

function JIRADsiplay() {
    return(
        <div>

        </div>
    );
}

function Header() {
    const optionList = ['Homepage','Create JIRA Story','Host Daily Standup','Host Retro']
    const pageRoute = ['/','/jira', '/dsu', '/retro']

    const renderedItmes = optionList.map((item, index) => (
        <div className='Navigator'>
            <Link className="element" to={pageRoute[index]}>{item}</Link>
        </div>  
    ));

    return(
        <header className='header'>
            {renderedItmes}
        </header>
    )

}

export default function JIRA() {
    return (
        <div className="JIRAPageCotainer">
            <Header />
            <div className="Content">
                <JIRACreate />
                <JIRADsiplay />
            </div>
        </div>
    );
}
